export class FetchClientResponse<T = string> {
	public data?: T;

	public status: number;

	public statusText: string;

	public success: boolean;

	public headers: Headers;

	constructor() {
		this.status = 200;
		this.statusText = "ok";
		this.headers = new Headers();
		this.success = false;
		this.data = undefined;
	}
}
